import React, { useReducer } from 'react';
type StateDataType = {
    count: number
}
type Action = {
    type: string
    payload: number
}

const reducer = (state: IState, action: IAction) => {
    switch (action.type) {
        case 'INCREMENT':
            return {
                count: state.count + action.payload
            }
        case 'DECREMENT':
            return {
                count: state.count - action.payload
            }
        default: return state
    }
}

